import logo from './logo.svg';
import {Input, Display} from './components/Input';
import './App.scss';
import React, { Component } from "react";

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      name: '',
      age: '',
      email: '',
      cell: ''
    };
  }

  handleChange = (e) => {
    console.log(e.target.value);
  }

  handleSubmit = (e) => {
    e.preventDefault();
    console.log('submitted');
  }
  render (){
    return(
    <div className="App">
    <Input hc={this.handleChange.bind(this)} hs={this.handleSubmit.bind(this)}sn='General' p1='Name' p2='Age' p3='E-Mail' p4='Cell #' />
    <Input hc={this.handleChange.bind(this)} hs={this.handleSubmit.bind(this)}sn='Education' p1='Name' p2='Age' p3='E-Mail' p4='Cell #' />
    <Input hc={this.handleChange.bind(this)} hs={this.handleSubmit.bind(this)}sn='Experience' p1='Name' p2='Age' p3='E-Mail' p4='Cell #' />
    <Display />
    </div>
  );}
}


export default App;
